s($,"aqE","a3S",function(){var q="Los Consejos de un Padre",p="\u2014\xbfEres el hombre?\u2014le pregunt\xf3.",o="\u2014\xbfD\xf3nde encontrar\xe9 al hombre?"
return H.a([F.acm("De Viaje","Travel",["DEJO \xe1 Barcelona entregada \xe1 su industria poderosa y \xe1 sus h\xe1bitos mercantiles y me vuelvo \xe1 Madrid.... Llego \xe1 la estaci\xf3n del ferrocarril en busca del tren que ha de conducirme \xe1 la corte, y advierto con profunda sorpresa que el and\xe9n est\xe1 lleno de peregrinos de todas clases, procedentes de Roma y que se disponen \xe1 regresar \xe1 sus pueblos respectivos.","En mi coche penetran varios, y entre ellos una se\xf1ora con una perra, \xe1 la que trata de ocultar en el seno para no incurrir en las iras de los empleados.... La perra, que es muy juguetona, salta sobre mis rodillas y se pone \xe1 escarbar encima de mis pantalones como si estuviera en el campo.","\u2014Celina\u2014le dice su ama cari\xf1osamente,\u2014lame \xe1 este caballero para manifestarle tus simpat\xedas.","\u2014No, se\xf1ora\u2014contesto yo,\u2014d\xedgale V. que no se moleste.","\u2014Quiero que vea V. su docilidad.","La perra dirige \xe1 la se\xf1ora una mirada de infinita ternura y se pone \xe1 lamer \xe1 los viajeros, uno por uno, hasta que llega \xe1 un fabricante de corchos, hombre iracundo, sin fe religiosa, ni aseo personal, que al sentirse lamido suelta un terno y quiere matar \xe1 la perra con el l\xedo de los paraguas.","Los dem\xe1s viajeros conseguimos tranquilizarle, y la se\xf1ora se ve acometida de un estremecimiento nervioso, y comienza \xe1 herir la delicadeza del fabricante desat\xe1ndose en improperios contra los corchos, hasta que llega el interventor del tren y exige el billete de la perra con mal talante.","\u2014\xbfC\xf3mo?\u2014grita la se\xf1ora.\u2014Un animalito que no pasa de los seis a\xf1os, \xbfva \xe1 pagar billete entero, como si fuese una persona mayor?","\u2014No hay m\xe1s remedio.","\u2014Pues esto es un abuso, y en cuanto llegue \xe1 Madrid se lo contar\xe9 todo \xe1 Conejo, que es de la mayor\xeda parlamentaria y se tutea con un primo de Salvador.","Al fin se conmueve el empleado, y exige s\xf3lo por la perra el importe de medio billete, consider\xe1ndola ni\xf1a de lanas.Y en \xe9stas y las otras llegamos \xe1 Manresa, donde hay varios viajeros esperando el tren para tomarlo poco menos que \xe1 la bayoneta.","La se\xf1ora se pone de pie delante de la portezuela \xe1 fin de evitar el asalto, pero ellos no cejan en su prop\xf3sito y atropellan todo lo existente.","Entre los reci\xe9n llegados figura un teniente de carabineros que viaja con un saco de noche, dos sombrereras, una escopeta de dos ca\xf1ones y un manojo de sables atados con un cordel. La perra ve aquellos instrumentos mort\xedferos y se pone \xe1 ladrar como una loca.","\u2014Aqu\xed no hay sitio para todo ese equipaje\u2014dice la se\xf1ora estrechando \xe1 la perra contra su coraz\xf3n.","\u2014\xbfQue no?\u2014contesta el militar sonriendo.","Y deja caer los bultos sobre el almohad\xf3n del coche; despu\xe9s se quita las botas, abre el saco de noche, saca unas babuchas que parecen dos orejas de elefante y se las calza con la mayor tranquilidad murmurando:","\u2014\xbfVe V. como hay sitio para todo?","La se\xf1ora se muerde los labios.","Detr\xe1s del teniente penetran dos curas y se sientan encima de la perra, haci\xe9ndola prorrumpir en sollozos agudos. Entonces ocurre lo que no puede referirse; la se\xf1ora pierde la calma y quiere ara\xf1ar al clero; el fabricante se subleva porque le ha pisado la se\xf1ora un juanete; ruge el carabinero y se asustan los sacerdotes hasta que se restablece la calma y cada cual busca el medio de descansar mejor.","Un peregrino se sienta \xe1 mi lado, apoya la cabeza en mi hombro y se queda dormido, roz\xe1ndome dulcemente la mejilla con la media docena de pelos que adornan su frente. Otro peregrino saca un salchich\xf3n, que parece una escopeta, y se pone \xe1 comer rajas y \xe1 tararear un himno piadoso. Algunas veces va \xe1 levantar el salchich\xf3n y me da con \xe9l en la cabeza.","Cuando llego \xe1 Madrid, quiero abrazar \xe1 un amigo que me espera en la estaci\xf3n y las fuerzas me faltan.\u2014\xbfQu\xe9 tienes?\u2014me pregunta.\u2014\xbfEst\xe1s malo?","\u2014\xbfC\xf3mo quieres que est\xe9 un hombre que ha venido desde Barcelona debajo de dos peregrinos, y amenazado constantemente por una perra, una se\xf1ora y un salchich\xf3n?"]),F.acm(q,q,["EL LE\xd3N, el rey de las selvas, agonizaba en el hueco de su caverna....","\xc1 su lado estaba su hijo, el nuevo le\xf3n, el rey futuro de todos los animales.","El monarca moribundo le daba penosamente el \xfaltimo consejo, el m\xe1s importante.","\u2014Huye del hombre\u2014le dec\xeda:\u2014huye siempre; no pretendas luchar con \xe9l.","Eres se\xf1or absoluto de los dem\xe1s animales, no los temas; dom\xednalos, cast\xedgalos, dev\xf3ralos si tienes hambre.","Con todos puedes luchar, \xe1 todos puedes vencer; pero no pretendas luchar con el hombre: te dar\xeda muerte y sin piedad, porque es cruel, m\xe1s cruel que nosotros.","\u2014\xbfTan fuerte es el hombre?\u2014pregunt\xf3 el hijo.","\u2014No es fuerte, no\u2014replic\xf3 el padre.\u2014Y continu\xf3 diciendo:\u2014De un latigazo de tu cola le podr\xedas lanzar por los aires como al m\xe1s miserable animalejo.","\u2014\xbfSus dientes, sus colmillos, son poderosos?","\u2014Son despreciables y rid\xedculos: valen menos que los de un ratoncillo.","\u2014\xbfSus u\xf1as, son tan potentes como mis zarpas?","\u2014Son mezquinas y \xe1 veces las lleva sucias; no, por las zarpas no conseguir\xeda vencerte.","\u2014\xbfTendr\xe1 melenas como \xe9stas, que nosotros sacudimos orgullosos?","\u2014No las tiene, y algunos son calvos.","Aqu\xed el le\xf3n moribundo abri\xf3 enormemente la espantosa boca..., y lanz\xf3 el \xfaltimo rugido.","Despu\xe9s s\xf3lo pronunci\xf3 estas palabras:","\u2014Mi consejo, mi \xfaltimo consejo; no luches con el hombre... huye... huye del hombre....","Se estremeci\xf3 su cuerpo; dobl\xf3 majestuosamente la cabeza, y muri\xf3 el le\xf3n padre.","Empez\xf3 el reinado del le\xf3n hijo.","Cuando \xe9ste comprendi\xf3 que su padre hab\xeda muerto, no llor\xf3, porque los leones no lloran; pero se tendi\xf3 junto \xe1 \xe9l, acerc\xf3 su cabeza enorme \xe1 la enorme cabeza del le\xf3n difunto, y as\xed se qued\xf3 un rato. Los dos hocicos se unieron: el ardiente y el helado. Las dos melenas se mezclaron....","Al fin el hijo se levant\xf3: sacudi\xf3 cola y melenas y rugi\xf3....","Sali\xf3 de la caverna: \xe1 zarpazos hizo rodar unos cuantos pedruscos, hasta cerrar completamente la entrada. El le\xf3n muerto ten\xeda ya su tumba, ni m\xe1s ni menos que un fara\xf3n.","El le\xf3n vivo se alej\xf3 por el monte y trompete\xf3 el nuevo reinado con tres poderosos rugidos; pero aquella noche no devor\xf3 \xe1 ning\xfan animal: no ten\xeda hambre. Durmi\xf3 poco y lo poco que durmi\xf3 fu\xe9 so\xf1ando con el \xfaltimo consejo de su padre. \xa1El hombre! \xa1El hombre! \xbfPor qu\xe9? \xbfSer\xeda el hombre tan temible?","\xc1 la ma\xf1ana siguiente despert\xf3 y se ech\xf3 por el mundo....","De pronto son\xf3 algo estrepitoso y terrible: algo \xe1 modo de rugido. Deb\xeda de ser el hombre que rug\xeda.","Pero no: era un borrico que rebuznaba con rebuznos formidables.","El le\xf3n, por impulso que no pudo contener, acometi\xf3 al borrico, le derrib\xf3 y le sujet\xf3 con sus poderosas garras.",p,"\u2014No\u2014contest\xf3 el pobre animal.\u2014No soy el hombre, \xa1aunque he o\xeddo decir que algunos se parecen \xe1 m\xed! Es un burro, es un borrico, se dice de muchos....",o,"\u2014Sigue este valle, salva esa monta\xf1a y quiz\xe1 lo encuentres al otro lado.","El le\xf3n solt\xf3 al borrico y sigui\xf3 su camino.","De pronto, algo se le enred\xf3 \xe1 una pierna; era una serpiente. Con violenta sacudida la arroj\xf3 \xe1 distancia; di\xf3 un salto y la sujet\xf3 con la pata.",p,"\u2014No soy el hombre; soy la serpiente.","\u2014\xbfSe parece \xe1 ti?","\u2014Algunos \xe1 m\xed se parecen; como yo, se arrastran; y como yo, son venenosos.",o,"\u2014Sigue por la monta\xf1a.... Pero d\xe9jame, que pesas mucho.","Y forceje\xf3 la serpiente y quiso morderle.","\u2014Eres un animal muy feo\u2014dijo el le\xf3n....","Y aplast\xf3 y desgarr\xf3 al reptil.","Continuando su camino pas\xf3 la cresta de la monta\xf1a y empez\xf3 \xe1 bajar.","De pronto vi\xf3 un animal que corr\xeda, y saltando sobre \xe9l, sin esfuerzo alguno lo sujet\xf3, porque era peque\xf1o y poco robusto.","\u2014\xbfQui\xe9n eres? \xbfAcaso eres el hombre?","\u2014Soy el zorro\u2014dijo el animalejo,\u2014y valgo tanto como el hombre por mi travesura; entro en sus corrales y me como sus gallinas, y \xe9l s\xf3lo aprovecha las que yo le dejo.","\u2014\xbfPero le conoces?","\u2014Mucho.","\u2014Pues, ven conmigo.","Y el le\xf3n y el zorro penetraron en el bosque.","En esto salt\xf3 un mono, se subi\xf3 \xe1 un \xe1rbol y desde arriba hizo gestos burlescos \xe1 su due\xf1o y se\xf1or, el rey de las selvas....","\u2014\xbfQu\xe9 animal es \xe9se?\u2014pregunt\xf3 el le\xf3n al zorro;\u2014\xbfes acaso el hombre?","\u2014No es el hombre; pero se le parece mucho. Algunos suponen que son hermanos, \xf3, por lo menos, primos....","\u2014\xa1Adelante! \xa1\xc1 buscar al hombre!... Un ser que se parece al borrico por el entendimiento, \xe1 la serpiente por lo rastrero y venenoso, al mono por la figura, y \xe1 quien el zorro le come las gallinas! \xa1\xc1 \xe9l! \xa1\xc1 \xe9l!\u2014rugi\xf3 el le\xf3n con poderosos rugidos.","Otro animal le cerr\xf3 el paso; le desafi\xf3 valiente; le ladr\xf3 furioso.","\u2014No hables mal del hombre, animal, b\xe1rbaro y salvaje. El hombre es bueno, es noble, es mi compa\xf1ero: parte conmigo su pan, duermo \xe1 los pies de su cama. Si le ofendes, me ofendes \xe1 m\xed: si luchas con \xe9l, luchar\xe9 \xe1 su lado; mi cuerpo ser\xe1 escudo que pare tus zarpazos.","\u2014Eres valiente\u2014dijo el le\xf3n.\u2014Quien cuenta con tan buen amigo, algo bueno tendr\xe1.","\u2014El hombre no tiene nada bueno, como no sean sus gallineros\u2014refunfu\xf1\xf3 el zorro.","Pero un \xe1guila real lleg\xf3 desde un picacho y tom\xf3 parte en la discusi\xf3n.","\u2014Calla, animalejo ruin: el hombre es un animal de cuenta: lo digo yo, que miro las cosas desde arriba....","El le\xf3n levant\xf3 la cabeza, y pregunt\xf3:","\u2014\xbfEl hombre vuela como t\xfa?","\u2014\xc9l no vuela: pero en su cabeza, como en jaula misteriosa, lleva una ave que vuela m\xe1s que yo y que sube m\xe1s alto.","\u2014\xbfC\xf3mo se llama?","\u2014El pensamiento.","\u2014No le conozco.","\u2014Tampoco yo.","El le\xf3n se qued\xf3 pensativo. \xbfQu\xe9 ser\xeda el hombre? Los borricos hablaban de \xe9l con desprecio, las serpientes con envidia, los zorros con burla, los monos le imitaban; pero el perro le defend\xeda y el \xe1guila le respetaba, y su padre, el m\xe1s poderoso le\xf3n de los bosques, mostr\xf3 temor al hablar del hombre.","\xbfQu\xe9 deber\xeda hacer? \xbfRespetar la \xfaltima voluntad del le\xf3n moribundo \xf3 buscar resuelto y domar valeroso al que pretend\xeda ser rey de la creaci\xf3n?","Vacil\xf3, pero el zorro le dijo:","\u2014Eres el animal m\xe1s fuerte que existe: eres nuestro soberano, \xbfy vas \xe1 huir cobardemente ante el hombre, de quien me burlo yo as\xed todos los d\xedas y todas las noches?...","\u2014\xbfY el consejo de mi padre? \xbfY su memoria que yo respeto? \xbfY su experiencia?","\u2014Tu padre estaba chocho: los a\xf1os apagaron su entendimiento y gastaron su fuerza.","El le\xf3n se decidi\xf3 \xe1 buscar al hombre y \xe1 combatir con \xe9l.","Continu\xf3 caminando por el bosque con el zorro al lado, el perro delante, el mono de \xe1rbol en \xe1rbol y el \xe1guila por los aires.","Al fin, el zorro le dijo:\u2014Mira, all\xed est\xe1. Aquel que va \xe1 caballo con arco y flechas, aqu\xe9l es el hombre.","\u2014Pero aquel animal que cruza \xe1 lo lejos es muy grande y tiene cuatro patas, y t\xfa me dijiste que el hombre se parec\xeda al mono.","\u2014Es que el hombre, \xe1 veces, tiene cuatro patas \xf3 las merece\u2014replic\xf3 el zorro con sorna.\u2014De todas maneras, has de saber que aquel hombre va \xe1 caballo.","\u2014\xa1Pues \xe1 \xe9l!\u2014rugi\xf3 el le\xf3n, y avanz\xf3 potente y valeroso.","Empez\xf3 la lucha.","El hombre \xe1 veces hu\xeda, \xe1 veces disparaba una flecha; y en retiradas y acometidas y evoluciones, atrajo al le\xf3n hacia unos matorrales.","De pronto, al dar el le\xf3n un salto, le falt\xf3 tierra y cay\xf3 en un foso profundo.","Quiso salir y sinti\xf3 que unas fuertes ligaduras le sujetaban manos y pies, y todo el cuerpo.","Hab\xeda ca\xeddo en una trampa; estaba perdido. Despu\xe9s de bregar un rato lo comprendi\xf3, y murmur\xf3 con roncas voces:\u2014Mi padre ten\xeda raz\xf3n, deb\xed huir del hombre: pero ya es tarde; y se dispuso \xe1 morir con dignidad....","Se qued\xf3 inm\xf3vil y dobl\xf3 la majestuosa cabeza.","Al borde del hoyo se asomaron con curiosidad el hombre, el perro, el zorro y el mono; el \xe1guila mir\xf3 desde arriba.","El hombre le arroj\xf3 una piedra al le\xf3n \xe1 ver si pod\xeda aplastarle la cabeza.","Pero el le\xf3n le dijo:","No me pegues ni me hieras en la cabeza.... Hi\xe9reme con una de las flechas EN LOS O\xcdDOS; los culpables son ellos, que no oyeron el consejo de mi padre: hi\xe9reme EN EL CORAZ\xd3N, que no le quiso ni respet\xf3 como deb\xeda.","Y volvi\xe9ndose el le\xf3n, present\xf3 el noble pecho.","El hombre, que \xe1 veces es compasivo, atendi\xf3 \xe1 su ruego, le dispar\xf3 una flecha y el le\xf3n qued\xf3 muerto en el fondo de la fosa.","El hombre se inclin\xf3 gozoso, pensando:\u2014Hermosa piel; se la arrancar\xe9 en cuanto me asegure que ha muerto.","El zorro se desliz\xf3 mirando al hombre de reojo, y diciendo para s\xed:\u2014Ahora que est\xe1s entretenido, voy \xe1 comerme tus gallinas.","El mono salt\xf3 sobre el perro, y en \xe9l se mont\xf3 imitando al hombre; caballo perruno y caballero cuadrumano, salieron corriendo por el bosque.","El \xe1guila se remont\xf3, diciendo:\u2014El hombre mat\xf3 al le\xf3n; hay que subir mucho para que no me alcance; \xbfqui\xe9n sabe si alg\xfan d\xeda me alcanzar\xe1?"])],H.P("o<KB>"))})
